int cmp(char s1[100], char s2[100])
{
	int len1 = strlen(s1);
	int len2 = strlen(s2);

	for (int i = 0; i < len1 && i<len2; i++)
	{
		if (s1[i] < s2[i]) return 1;
		else if (s1[i] > s2[i]) return -1;
	}

	if (len1 > len2) return -1;
	else if (len1 == len2) return 0;
	else return 1;
}

void quickSort(int first, int last)
{
	int pivot;
	int i;
	int j;
	char temp[100];
	if (first < last)
	{
		pivot = first;
		i = first;
		j = last;

		while (i < j)
		{
			//이건 오름 차순으로 정렬을 하는 거란 말이지?? 살펴보자면
			//
			while (cmp(str[i], str[pivot]) >= 0 && i < last) // 피봇이 크다면 맞는거니까 계쏙 증가 시켜준다.
			{
				i++;
			}
			while (cmp(str[pivot], str[j])>0) // 피봇이 더작다면 맞는것 감소시켜준다.
			{
				j--;
			}
			if (i < j)
			{
				strcpy(temp, str[i]);
				strcpy(str[i], str[j]);
				strcpy(str[j], temp);
			}
		}

		strcpy(temp, str[pivot]);
		strcpy(str[pivot], str[j]);
		strcpy(str[j], temp);

		quickSort(first, j - 1);
		quickSort(j + 1, last);
	}
}

