void prove()
{
	bool chk = true;
	for (int i = 0; i < num - 1; i++)
	{
		//(str[i],str[i+1]) //얘를 비교하면되는데..
		//뒤에꺼가 더 긴 아이 여야한다.

		if (cmp(str[i], str[i + 1]) < 0)
		{
			chk = false;
			break;
		}
	}

	if (chk)
	{
		cout << "Pass" << endl;
	}
	else
	{
		cout << "Fail" << endl;
	}
}

